from pathlib import Path
from collections import namedtuple
from decimal import Decimal


Monitoring = namedtuple('Monitoring', 'percentage')
monitoring = Monitoring([])
Geodata = namedtuple('Geodata', ['latitude', 'longitude'])
geodata = Geodata([], [])
AppData = namedtuple('Appdata', ['status', 'message'])
appdata = AppData([], [])
unhandled_data = []
file = Path('D:/Step/python/ДЗ/09.26/# buffer.txt')


# ИСПОЛЬЗОВАТЬ: в имени параметра функции особенно важно указать, что вы ожидаете: путь или файлоподобный объект
def get_data_from_buffer(file_path: Path, *, sep: str = ';') -> str:
    # ИСПОЛЬЗОВАТЬ: слово "вывод" обычно используется в контексте работы со стандартным потоком
    """Функция-генератор, возвращает пакеты данных, полученных из файла."""
    with open(file_path, encoding='utf-8') as filein:
        data = filein.readline()
        for packet in data.split(sep):
            yield packet


def parse_data(data_flow: iter) -> None:
    """В зависимости от содержимого полученных пакетов данных, записывает данные в нужном формате в соответствующие именованные кортежи."""
    for data in data_flow:
        if data.endswith(':lat'):
            geodata.latitude.append(Decimal(data.rstrip(':lat')))
        elif data.endswith(':lng'):
            geodata.longitude.append(Decimal(data.rstrip(':lng')))
        elif data.endswith('%'):
            monitoring.percentage.append(Decimal(data.rstrip('%')))
        elif data.isalpha():
            appdata.message.append(data)
        elif data.isdecimal():
            appdata.status.append(int(data))
        else:
            unhandled_data.append(data)


# ИСПОЛЬЗОВАТЬ: для лучшего различения глобальных и локальных переменных
buffer = get_data_from_buffer(file)
parse_data(buffer)

print(monitoring, '\n')
print(geodata.latitude, '\n')
print(geodata.longitude, '\n')
print(appdata.status, '\n')
print(appdata.message)
print(unhandled_data)


